import React from 'react';
import './Home.css';
import cafeImage from '../assets/cafe.jpeg'; // Adjust the path based on your structure

const Home = () => {
  return (
    <div id="home" className="home">
      {/* Image Section */}
      <div className="home-image-container">
        <img src={cafeImage} alt="Food Hall Café" className="home-image" />
      </div>

      {/* Content Section */}
      <div className="home-content">
        <h1>Welcome to Food Hall Café</h1>
        <p>Experience the perfect blend of comfort, taste, and ambiance. Join us for an unforgettable coffee experience!</p>
      </div>
    </div>
  );
};

export default Home;
